import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './contact.css';

const ContactButton=()=>{

    const clicked=()=>{
        console.log("clicked");
    };
    
    return(
        <Fragment>
            <button className="contact_bt" id="contact" onClick={clicked}>Contact_Me_</button>
        </Fragment>
    );
};

export default ContactButton;
